                    new ContentIntegrate { Id = 0, Name = "About", NavigateTree = "/about/", NavigatePath = "/about/", TitleHtml = "<i class=\"fas fa-info-circle\"></i> About", TitleLong = "About WorkplaceX Framework", TextMd = "# About\nWorkplaceX is an initiative to standardize and streamline the development of business applications. It is based on ASP.NET Core, Angular, SQL Server, Bootstrap or Bulma. No further third party components are used. And it\'s all open source.\n\n![](/assets/pillar.png)\n\n## Support\nWe provide online support. Send us an email to **info(at)workplacex.org**\n\nOr feel free to contact us on twitter https://twitter.com/workplacex\n\n## Support Us\nYour support is vital in enabling Workplacex.org initiative to fulfill its mission to share and further develop its code base. You can do so by:\n* Make suggestions for new features you’d like to see\n* Let others know about it\n* Give us a star on GitHub\n* Submit a pull request\n* Use it for your next project", TextHtml = "<h1><a id=\"about\" class=\"anchor\" aria-hidden=\"true\"></a>About</h1><p>WorkplaceX is an initiative to standardize and streamline the development of business applications. It is based on ASP.NET Core, Angular, SQL Server, Bootstrap or Bulma. No further third party components are used. And it\'s all open source.</p><p></p><img src=\"/assets/pillar.png\" alt=\"/assets/pillar.png\" /><p></p><h2><a id=\"support\" class=\"anchor\" aria-hidden=\"true\"></a>Support</h2><p>We provide online support. Send us an email to <strong>info(at)workplacex.org</strong></p><p>Or feel free to contact us on twitter <a href=\"https://twitter.com/workplacex\">https://twitter.com/workplacex</a></p><p></p><h2><a id=\"support-us\" class=\"anchor\" aria-hidden=\"true\"></a>Support Us</h2><p>Your support is vital in enabling Workplacex.org initiative to fulfill its mission to share and further develop its code base. You can do so by:</p><ul><li>Make suggestions for new features you’d like to see</li><li>Let others know about it</li><li>Give us a star on GitHub</li><li>Submit a pull request</li><li>Use it for your next project</li></ul>", Sort = 5, SitemapDate = DateTime.Parse("2021-04-22 10:40", CultureInfo.InvariantCulture), IdName = "About" },
                    new ContentIntegrate { Id = 0, Name = "Application", NavigateTree = "/install/app/", NavigatePath = "/install/", TitleHtml = "<i class=\"fas fa-window-maximize\"></i> Application", TitleLong = "Install Application from Scratch", TextMd = "# Getting Started\nThe following two components need to be installed on the machine as prerequisite:\n* [Node.js](https://nodejs.org/en/) (LTS Version)\n* [.NET Core](https://dotnet.microsoft.com/download) (Version 5.0)\n* [SQL Server](https://www.microsoft.com/en-us/sql-server/sql-server-downloads) (Free Express Edition)\n\nWeb [Application Demo](https://github.com/WorkplaceX/ApplicationDemo) is a comprehensive example to get started with:\n\n## Install\n```cmd\n### Git clone (parameter recursive clones also required submodule Framework):\ngit clone https://github.com/WorkplaceX/ApplicationDemo.git --recursive\n\ncd ApplicationDemo\n\n### On first launch it will ask to register wpx command in environment path:\n./wpx.cmd # For Windows\n./wpx.sh # For Linux\n\n### From now on just use:\nwpx\n\n### Build\nwpx build # Builds client (Angular) and server (.NET)\n\n### Set ConnectionString\nwpx config connectionString=\"Data Source=localhost; Initial Catalog=ApplicationDemo; Integrated Security=True;\" # Example Windows\nwpx config connectionString=\"Data Source=localhost; Initial Catalog=ApplicationDemo; User Id=SA; Password=MyPassword;\" # Example Linux\n\n### Deploy Database\nwpx deployDb\n\n### Start\nwpx start # http://localhost:5000/\n\n### Stop\nkillall -g -SIGKILL -r Application.S # Example Linux. Close group (regular expression for Application.Server)\nsudo netstat -ltp # Show all program listening to port # Example Linux```\n\n## Command Line Interface (CLI)\nThe framework provides a command line interface (CLI) with all necessary functions like build, deploy and so on. In the root folder type cli.\n```cmd\ncd ApplicationDemo\nwpx\n```\nAll available framework CLI commands are listed like this:\n![](/assets/cli.png)", TextHtml = "<h1><a id=\"getting-started\" class=\"anchor\" aria-hidden=\"true\"></a>Getting Started</h1><p>The following two components need to be installed on the machine as prerequisite:</p><ul><li><a href=\"https://nodejs.org/en/\">Node.js</a> (LTS Version)</li><li><a href=\"https://dotnet.microsoft.com/download\">.NET Core</a> (Version 5.0)</li><li><a href=\"https://www.microsoft.com/en-us/sql-server/sql-server-downloads\">SQL Server</a> (Free Express Edition)</li></ul><p>Web <a href=\"https://github.com/WorkplaceX/ApplicationDemo\">Application Demo</a> is a comprehensive example to get started with:</p><p></p><h2><a id=\"install\" class=\"anchor\" aria-hidden=\"true\"></a>Install</h2><p></p><pre><code class=\"language-cmd\">### Git clone (parameter recursive clones also required submodule Framework):\ngit clone https://github.com/WorkplaceX/ApplicationDemo.git --recursive\n\ncd ApplicationDemo\n\n### On first launch it will ask to register wpx command in environment path:\n./wpx.cmd # For Windows\n./wpx.sh # For Linux\n\n### From now on just use:\nwpx\n\n### Build\nwpx build # Builds client (Angular) and server (.NET)\n\n### Set ConnectionString\nwpx config connectionString=\"Data Source=localhost; Initial Catalog=ApplicationDemo; Integrated Security=True;\" # Example Windows\nwpx config connectionString=\"Data Source=localhost; Initial Catalog=ApplicationDemo; User Id=SA; Password=MyPassword;\" # Example Linux\n\n### Deploy Database\nwpx deployDb\n\n### Start\nwpx start # http://localhost:5000/\n\n### Stop\nkillall -g -SIGKILL -r Application.S # Example Linux. Close group (regular expression for Application.Server)\nsudo netstat -ltp # Show all program listening to port # Example Linux</code></pre><p></p><h2><a id=\"command-line-interface-(cli)\" class=\"anchor\" aria-hidden=\"true\"></a>Command Line Interface (CLI)</h2><p>The framework provides a command line interface (CLI) with all necessary functions like build, deploy and so on. In the root folder type cli.</p><pre><code class=\"language-cmd\">cd ApplicationDemo\nwpx</code></pre><p>All available framework CLI commands are listed like this:</p><img src=\"/assets/cli.png\" alt=\"/assets/cli.png\" />", Sort = 21, SitemapDate = DateTime.Parse("2021-04-21 01:17", CultureInfo.InvariantCulture), IdName = "Application" },
                    new ContentIntegrate { Id = 0, Name = "Cli", NavigateTree = "/cli/", NavigatePath = "/cli/", TitleHtml = "<i class=\"fas fa-desktop\"></i> CLI", TitleLong = "Command Line Interface (CLI)", TextMd = "# Command Line Interface (CLI)\nProvides all commands for application development. Start the CLI with the following command. Make sure you are in a WorkplaceX application root directory.\n```cmd\nwpx\n```\nList of CLI commands:\n* build (Build Angular client and ASP.NET Core server)\n* config (Read and write config. For example ConnectionString for DEV, TEST)\n* deploy (Deploy app to Azure)\n* deployDb (Deploy sql database by running scripts)\n* env (Switch environment for example between DEV and PROD)\n* generate (Generate CSharp code classes from sql database schema)\n* start (start application. localhost:5000)\n* test (run all unit tests)\n\n![](/assets/cli.png)", TextHtml = "<h1><a id=\"command-line-interface-(cli)\" class=\"anchor\" aria-hidden=\"true\"></a>Command Line Interface (CLI)</h1><p>Provides all commands for application development. Start the CLI with the following command. Make sure you are in a WorkplaceX application root directory.</p><pre><code class=\"language-cmd\">wpx</code></pre><p>List of CLI commands:</p><ul><li>build (Build Angular client and ASP.NET Core server)</li><li>config (Read and write config. For example ConnectionString for DEV, TEST)</li><li>deploy (Deploy app to Azure)</li><li>deployDb (Deploy sql database by running scripts)</li><li>env (Switch environment for example between DEV and PROD)</li><li>generate (Generate CSharp code classes from sql database schema)</li><li>start (start application. localhost:5000)</li><li>test (run all unit tests)</li></ul><p></p><img src=\"/assets/cli.png\" alt=\"/assets/cli.png\" />", Sort = 4, SitemapDate = DateTime.Parse("2021-04-21 01:15", CultureInfo.InvariantCulture), IdName = "Cli" },
                    new ContentIntegrate { Id = 0, Name = "Code", NavigateTree = "/code/", NavigatePath = "/code/", TitleHtml = "<i class=\"fas fa-code-branch\"></i> Code", TitleLong = null, TextMd = "# Code Examples\nGet started with the following simple code examples:\n* [Hello World Text](#hello-world-text) (Show simple hello world text)\n* [Data Grid](#data-grid) (Add sql server data grid to web application)\n* [Data Annotation](#data-annotation) (Green arrow up for positive numbers)\n* [Data Lookup Window](#data-lookup-window) (Data lookup up or autocomplete window)\n\n# Hello World Text", TextHtml = "<h1><a id=\"code-examples\" class=\"anchor\" aria-hidden=\"true\"></a>Code Examples</h1><p>Get started with the following simple code examples:</p><ul><li><a href=\"#hello-world-text\">Hello World Text</a> (Show simple hello world text)</li><li><a href=\"#data-grid\">Data Grid</a> (Add sql server data grid to web application)</li><li><a href=\"#data-annotation\">Data Annotation</a> (Green arrow up for positive numbers)</li><li><a href=\"#data-lookup-window\">Data Lookup Window</a> (Data lookup up or autocomplete window)</li></ul><p></p><h1><a id=\"hello-world-text\" class=\"anchor\" aria-hidden=\"true\"></a>Hello World Text</h1>", Sort = 3, SitemapDate = DateTime.Parse("2021-04-21 01:19", CultureInfo.InvariantCulture), IdName = "Code" },
                    new ContentIntegrate { Id = 0, Name = "Code Annotation", NavigateTree = "/code/annotation/", NavigatePath = "/annotation/", TitleHtml = "<i class=\"fas fa-asterisk\"></i> Annotation", TitleLong = "Grid Data Annotation", TextMd = "# Data Annotation\nAdding visual icons to a data grid can improve readability substantially. Following example shows positive numbers with a green up arrow. And negative numbers with a red down arrow.\n![](/assets/data-grid-annotation.png)\n\n## Implementation\nThis example builds on [Data Grid Example](/data-grid) and shows how to annotate data grid cells.\n\n```csharp\n// File: Application/App/AppMain.cs\n\nnamespace Application.Doc\n{\n    using Database.dbo;\n    using Framework.DataAccessLayer;\n    using Framework.Json;\n    using System.Linq;\n    using System.Threading.Tasks;\n\n    public class AppMain : AppJson\n    {\n        public override async Task InitAsync()\n        {\n            await new GridHelloWorld(this).LoadAsync();\n        }\n    }\n\n    public class GridHelloWorld : Grid<HelloWorld>\n    {\n        public GridHelloWorld(ComponentJson owner) \n            : base(owner)\n        {\n\n        }\n\n        protected override void Query(QueryArgs args, QueryResult result)\n        {\n            result.Query = Data.Query<HelloWorld>().OrderBy(item => item.Text);\n        }\n\n        protected override void CellAnnotation(AnnotationArgs args, AnnotationResult result)\n        {\n            if (args.FieldName == nameof(HelloWorld.Number))\n            {\n                if (args.Row.Number > 0)\n                {\n                    result.HtmlLeft = \"<i class=\'fas fa-arrow-up green\'></i>\";\n                }\n                if (args.Row.Number < 0)\n                {\n                    result.HtmlLeft = \"<i class=\'fas fa-arrow-down red\'></i>\";\n                }\n                if (args.Row.Number == 0)\n                {\n                    result.HtmlLeft = \"<i class=\'fas fa-arrow-right\'></i>\";\n                }\n            }\n        }\n    }\n}\n```\n\n", TextHtml = "<h1><a id=\"data-annotation\" class=\"anchor\" aria-hidden=\"true\"></a>Data Annotation</h1><p>Adding visual icons to a data grid can improve readability substantially. Following example shows positive numbers with a green up arrow. And negative numbers with a red down arrow.</p><img src=\"/assets/data-grid-annotation.png\" alt=\"/assets/data-grid-annotation.png\" /><p></p><h2><a id=\"implementation\" class=\"anchor\" aria-hidden=\"true\"></a>Implementation</h2><p>This example builds on <a href=\"/data-grid\">Data Grid Example</a> and shows how to annotate data grid cells.</p><p></p><pre><code class=\"language-csharp\">// File: Application/App/AppMain.cs\n\nnamespace Application.Doc\n{\n    using Database.dbo;\n    using Framework.DataAccessLayer;\n    using Framework.Json;\n    using System.Linq;\n    using System.Threading.Tasks;\n\n    public class AppMain : AppJson\n    {\n        public override async Task InitAsync()\n        {\n            await new GridHelloWorld(this).LoadAsync();\n        }\n    }\n\n    public class GridHelloWorld : Grid&lt;HelloWorld&gt;\n    {\n        public GridHelloWorld(ComponentJson owner) \n            : base(owner)\n        {\n\n        }\n\n        protected override void Query(QueryArgs args, QueryResult result)\n        {\n            result.Query = Data.Query&lt;HelloWorld&gt;().OrderBy(item =&gt; item.Text);\n        }\n\n        protected override void CellAnnotation(AnnotationArgs args, AnnotationResult result)\n        {\n            if (args.FieldName == nameof(HelloWorld.Number))\n            {\n                if (args.Row.Number &gt; 0)\n                {\n                    result.HtmlLeft = &quot;&lt;i class=&apos;fas fa-arrow-up green&apos;&gt;&lt;/i&gt;&quot;;\n                }\n                if (args.Row.Number &lt; 0)\n                {\n                    result.HtmlLeft = &quot;&lt;i class=&apos;fas fa-arrow-down red&apos;&gt;&lt;/i&gt;&quot;;\n                }\n                if (args.Row.Number == 0)\n                {\n                    result.HtmlLeft = &quot;&lt;i class=&apos;fas fa-arrow-right&apos;&gt;&lt;/i&gt;&quot;;\n                }\n            }\n        }\n    }\n}</code></pre><p></p>", Sort = 4, SitemapDate = DateTime.Parse("2021-04-22 10:44", CultureInfo.InvariantCulture), IdName = "Code Annotation" },
                    new ContentIntegrate { Id = 0, Name = "Code Counter", NavigateTree = "/code/counter/", NavigatePath = "/counter/", TitleHtml = "<i class=\"fas fa-mouse\"></i> Counter", TitleLong = "Hello World Counter Example", TextMd = "# Hello World Counter\nFollowing example shows how to add a button and count on every click.\n(Note)\n**AppMain** is basically a json object. The variables Html and Button are references which are stored accordingly at the end of every request.\n(Note)\n\n```cmd\nnamespace Application\n{\n    using Framework.Json;\n    using System.Threading.Tasks;\n\n    public class AppMain : AppJson\n    {\n        public AppMain()\n        {\n            Html = new Html(this) { TextHtml = \"Hello World\" };\n            Button = new Button(this) { TextHtml = \"Click\" };\n        }\n\n        public Html Html;\n\n        public Button Button;\n\n        public int Count;\n\n        protected override Task ProcessAsync()\n        {\n            if (Button.IsClick)\n            {\n                Count += 1;\n                Html.TextHtml = Count.ToString();\n            }\n            return base.ProcessAsync();\n        }\n    }\n}\n```\n\nCounts on every click:\n![](/assets/counter.png)\n", TextHtml = "<h1><a id=\"hello-world-counter\" class=\"anchor\" aria-hidden=\"true\"></a>Hello World Counter</h1><p>Following example shows how to add a button and count on every click.</p><article class=\"message is-warning\"><div class=\"message-body\"><p><strong>AppMain</strong> is basically a json object. The variables Html and Button are references which are stored accordingly at the end of every request.</p></div></article><p></p><pre><code class=\"language-cmd\">namespace Application\n{\n    using Framework.Json;\n    using System.Threading.Tasks;\n\n    public class AppMain : AppJson\n    {\n        public AppMain()\n        {\n            Html = new Html(this) { TextHtml = &quot;Hello World&quot; };\n            Button = new Button(this) { TextHtml = &quot;Click&quot; };\n        }\n\n        public Html Html;\n\n        public Button Button;\n\n        public int Count;\n\n        protected override Task ProcessAsync()\n        {\n            if (Button.IsClick)\n            {\n                Count += 1;\n                Html.TextHtml = Count.ToString();\n            }\n            return base.ProcessAsync();\n        }\n    }\n}</code></pre><p>Counts on every click:</p><img src=\"/assets/counter.png\" alt=\"/assets/counter.png\" /><p></p>", Sort = 2, SitemapDate = DateTime.Parse("2021-04-22 10:44", CultureInfo.InvariantCulture), IdName = "Code Counter" },
                    new ContentIntegrate { Id = 0, Name = "Code Data Grid", NavigateTree = "/code/data-grid/", NavigatePath = "/data-grid/", TitleHtml = "<i class=\"fas fa-table\"></i> Data Grid", TitleLong = "From Database to DataGrid", TextMd = "# From Database to Data Grid\nThis example shows how to bring an sql table or view directly to the browser including filtering, sorting, paging and Excel export.\n![](/assets/db-to-data-grid.png)\n\n## Create SQL Table\nFirst let\'s create a new database table.\n```sql\nCREATE TABLE HelloWorld\n(\n    Id INT PRIMARY KEY IDENTITY,\n    Text NVARCHAR(256),\n    Number FLOAT\n)\n```\n## Generate C# Code\nNext we need C# code for this table. Run command line:\n```cmd\nwpx generate\n```\n\nThis generates the following code for us:\n\n```csharp\n// File: Application.Database/Database/Database.cs\n\nnamespace Database.dbo\n{\n    using Framework.DataAccessLayer;\n    using System;\n\n    [SqlTable(\"dbo\", \"HelloWorld\")]\n    public class HelloWorld : Row\n    {\n        [SqlField(\"Id\", true, FrameworkTypeEnum.Int)]\n        public int Id { get; set; }\n\n        [SqlField(\"Text\", FrameworkTypeEnum.Nvarcahr)]\n        public string Text { get; set; }\n\n        [SqlField(\"Number\", FrameworkTypeEnum.Float)]\n        public double? Number { get; set; }\n    }\n}\n```\n\n## Show Data in App\nIn order to load the data grid write:\n```csharp\n// File: Application/App/AppMain.cs\n\nnamespace Application.Doc\n{\n    using Database.dbo;\n    using Framework.DataAccessLayer;\n    using Framework.Json;\n    using System.Linq;\n    using System.Threading.Tasks;\n\n    public class AppMain : AppJson\n    {\n        public override async Task InitAsync()\n        {\n            await new GridHelloWorld(this).LoadAsync();\n        }\n    }\n\n    public class GridHelloWorld : Grid<HelloWorld>\n    {\n        public GridHelloWorld(ComponentJson owner) \n            : base(owner)\n        {\n\n        }\n\n        protected override void Query(QueryArgs args, QueryResult result)\n        {\n            result.Query = Data.Query<HelloWorld>().OrderBy(item => item.Text);\n        }\n    }\n}\n```\nStart the program. It looks like this, sorting and filtering already included and working:\n![](/assets/data-grid.png)", TextHtml = "<h1><a id=\"from-database-to-data-grid\" class=\"anchor\" aria-hidden=\"true\"></a>From Database to Data Grid</h1><p>This example shows how to bring an sql table or view directly to the browser including filtering, sorting, paging and Excel export.</p><img src=\"/assets/db-to-data-grid.png\" alt=\"/assets/db-to-data-grid.png\" /><p></p><h2><a id=\"create-sql-table\" class=\"anchor\" aria-hidden=\"true\"></a>Create SQL Table</h2><p>First let\'s create a new database table.</p><pre><code class=\"language-sql\">CREATE TABLE HelloWorld\n(\n    Id INT PRIMARY KEY IDENTITY,\n    Text NVARCHAR(256),\n    Number FLOAT\n)</code></pre><p></p><h2><a id=\"generate-c#-code\" class=\"anchor\" aria-hidden=\"true\"></a>Generate C# Code</h2><p>Next we need C# code for this table. Run command line:</p><pre><code class=\"language-cmd\">wpx generate</code></pre><p>This generates the following code for us:</p><p></p><pre><code class=\"language-csharp\">// File: Application.Database/Database/Database.cs\n\nnamespace Database.dbo\n{\n    using Framework.DataAccessLayer;\n    using System;\n\n    [SqlTable(&quot;dbo&quot;, &quot;HelloWorld&quot;)]\n    public class HelloWorld : Row\n    {\n        [SqlField(&quot;Id&quot;, true, FrameworkTypeEnum.Int)]\n        public int Id { get; set; }\n\n        [SqlField(&quot;Text&quot;, FrameworkTypeEnum.Nvarcahr)]\n        public string Text { get; set; }\n\n        [SqlField(&quot;Number&quot;, FrameworkTypeEnum.Float)]\n        public double? Number { get; set; }\n    }\n}</code></pre><p></p><h2><a id=\"show-data-in-app\" class=\"anchor\" aria-hidden=\"true\"></a>Show Data in App</h2><p>In order to load the data grid write:</p><pre><code class=\"language-csharp\">// File: Application/App/AppMain.cs\n\nnamespace Application.Doc\n{\n    using Database.dbo;\n    using Framework.DataAccessLayer;\n    using Framework.Json;\n    using System.Linq;\n    using System.Threading.Tasks;\n\n    public class AppMain : AppJson\n    {\n        public override async Task InitAsync()\n        {\n            await new GridHelloWorld(this).LoadAsync();\n        }\n    }\n\n    public class GridHelloWorld : Grid&lt;HelloWorld&gt;\n    {\n        public GridHelloWorld(ComponentJson owner) \n            : base(owner)\n        {\n\n        }\n\n        protected override void Query(QueryArgs args, QueryResult result)\n        {\n            result.Query = Data.Query&lt;HelloWorld&gt;().OrderBy(item =&gt; item.Text);\n        }\n    }\n}</code></pre><p>Start the program. It looks like this, sorting and filtering already included and working:</p><img src=\"/assets/data-grid.png\" alt=\"/assets/data-grid.png\" />", Sort = 3, SitemapDate = DateTime.Parse("2021-04-22 10:44", CultureInfo.InvariantCulture), IdName = "Code Data Grid" },
                    new ContentIntegrate { Id = 0, Name = "Code Hello World", NavigateTree = "/code/hello-world/", NavigatePath = "/hello-world/", TitleHtml = "<i class=\"fas fa-globe\"></i> Hello World", TitleLong = "Hello World Code Example", TextMd = "# Hello World Example\nFollowing example shows how to display a simple text.\n\nThe namespace Framework.Json contains all semantic components to build a logical tree. It contains components like button, navbar or data grid. This logical tree is different from the html tree. The logical tree contains only relevant data to build an html tree. Only the logical tree is serialized and stored on the server at the end of a request.\n\n(Note)\n**AppJson** is the root component of any application. On an incoming request the framework looks in the file ConfigServer.json to decide which root component to take.\n(Note)\n\n\n```csharp\nnamespace Application\n{\n    using Framework.Json;\n\n    public class AppMain : AppJson\n    {\n        public AppMain()\n        {\n            new Html(this) { TextHtml = \"Hello World\" };\n        }\n    }\n}\n```\n\nOutput looks like this:\n![](/assets/hello-world.png)", TextHtml = "<h1><a id=\"hello-world-example\" class=\"anchor\" aria-hidden=\"true\"></a>Hello World Example</h1><p>Following example shows how to display a simple text.</p><p>The namespace Framework.Json contains all semantic components to build a logical tree. It contains components like button, navbar or data grid. This logical tree is different from the html tree. The logical tree contains only relevant data to build an html tree. Only the logical tree is serialized and stored on the server at the end of a request.</p><p></p><article class=\"message is-warning\"><div class=\"message-body\"><p><strong>AppJson</strong> is the root component of any application. On an incoming request the framework looks in the file ConfigServer.json to decide which root component to take.</p></div></article><p></p><pre><code class=\"language-csharp\">namespace Application\n{\n    using Framework.Json;\n\n    public class AppMain : AppJson\n    {\n        public AppMain()\n        {\n            new Html(this) { TextHtml = \"Hello World\" };\n        }\n    }\n}</code></pre><p>Output looks like this:</p><img src=\"/assets/hello-world.png\" alt=\"/assets/hello-world.png\" />", Sort = 1, SitemapDate = DateTime.Parse("2021-04-22 10:15", CultureInfo.InvariantCulture), IdName = "Code Hello World" },
                    new ContentIntegrate { Id = 0, Name = "Excel", NavigateTree = "/excel/", NavigatePath = "/excel/", TitleHtml = "<i class=\"fas fa-file-excel\"></i> Excel", TitleLong = "Excel Export and Import", TextMd = "# Excel Export and Import\nAny data grid can be exported and imported (coming soon).\n![](/assets/excel-export.png)\n## Export\nClick the blue \"Excel download\" icon.\n![](/assets/data-grid.png)\n\n", TextHtml = "<h1><a id=\"excel-export-and-import\" class=\"anchor\" aria-hidden=\"true\"></a>Excel Export and Import</h1><p>Any data grid can be exported and imported (coming soon).</p><img src=\"/assets/excel-export.png\" alt=\"/assets/excel-export.png\" /><p></p><h2><a id=\"export\" class=\"anchor\" aria-hidden=\"true\"></a>Export</h2><p>Click the blue \"Excel download\" icon.</p><img src=\"/assets/data-grid.png\" alt=\"/assets/data-grid.png\" /><p></p>", Sort = 4.5, SitemapDate = DateTime.Parse("2021-04-22 10:33", CultureInfo.InvariantCulture), IdName = "Excel" },
                    new ContentIntegrate { Id = 0, Name = "Home", NavigateTree = "/", NavigatePath = "/", TitleHtml = "<i class=\"fas fa-home\"></i> Home", TitleLong = "Business Application Framework", TextMd = "# Web Application Framework\nWorkplaceX is an open source framework to simplify business application development. It provides the following features “out of the box”:\n\n![](/assets/screen-cast.gif)\n\n* Data grids (high performance with millions of records and hundreds of columns)\n* Paging (horizontal and vertical), sorting, filtering\n* Lookup window and autocomplete function\n* Master detail relations\n* Modern looking browser web front end (desktop and mobile)\n* Menu Navigation\n* Data access to SQL server and/or memory\n* Multilanguage support\n* Configuration\n\nIt standardizes and simplifies the process of building enterprise business applications on top of existing SQL Server Databases. It can be hosted on premise or in the cloud and is based on the following products:\n\n* ASP.NET Core 5.0\n* Bootstrap 4 and/or Bulma\n* Angular 11 (Also server side rendering for high performance first page load)\n* SQL Server\n\nAllow thousands of users to access and manage your companies data in a controlled manner. Be flexible and evolve business models as the marked changes.\n\nDeliver complex web applications, without having to touch Html or JavaScript when adding new sql columns, tables or views. The framework fully supports continuous integration and delivery (CI/CD) and seamlessly integrates with\n\n* [Travis CI](https://travis-ci.org/)\n* [GitHub Actions](https://github.com/features/actions)\n* [Azure Pipelines](https://azure.microsoft.com/en-us/services/devops/pipelines/)\n\n# Live Example\nSee a live example: [https://demo.WorkplaceX.org](https://demo.workplacex.org)\n\n## GitHub\nOr download the source code from GitHub: **[ApplicationDemo](https://github.com/WorkplaceX/ApplicationDemo)** \n\nAdditionally, WorkplaceX business applications run also embedded in SharePoint or on any already existing company web page by just adding a few lines of html code.\n\n", TextHtml = "<h1><a id=\"web-application-framework\" class=\"anchor\" aria-hidden=\"true\"></a>Web Application Framework</h1><p>WorkplaceX is an open source framework to simplify business application development. It provides the following features “out of the box”:</p><p></p><img src=\"/assets/screen-cast.gif\" alt=\"/assets/screen-cast.gif\" /><p></p><ul><li>Data grids (high performance with millions of records and hundreds of columns)</li><li>Paging (horizontal and vertical), sorting, filtering</li><li>Lookup window and autocomplete function</li><li>Master detail relations</li><li>Modern looking browser web front end (desktop and mobile)</li><li>Menu Navigation</li><li>Data access to SQL server and/or memory</li><li>Multilanguage support</li><li>Configuration</li></ul><p>It standardizes and simplifies the process of building enterprise business applications on top of existing SQL Server Databases. It can be hosted on premise or in the cloud and is based on the following products:</p><p></p><ul><li>ASP.NET Core 5.0</li><li>Bootstrap 4 and/or Bulma</li><li>Angular 11 (Also server side rendering for high performance first page load)</li><li>SQL Server</li></ul><p>Allow thousands of users to access and manage your companies data in a controlled manner. Be flexible and evolve business models as the marked changes.</p><p>Deliver complex web applications, without having to touch Html or JavaScript when adding new sql columns, tables or views. The framework fully supports continuous integration and delivery (CI/CD) and seamlessly integrates with</p><p></p><ul><li><a href=\"https://travis-ci.org/\">Travis CI</a></li><li><a href=\"https://github.com/features/actions\">GitHub Actions</a></li><li><a href=\"https://azure.microsoft.com/en-us/services/devops/pipelines/\">Azure Pipelines</a></li></ul><p></p><h1><a id=\"live-example\" class=\"anchor\" aria-hidden=\"true\"></a>Live Example</h1><p>See a live example: <a href=\"https://demo.workplacex.org\">https://demo.WorkplaceX.org</a></p><p></p><h2><a id=\"github\" class=\"anchor\" aria-hidden=\"true\"></a>GitHub</h2><p>Or download the source code from GitHub: <strong><a href=\"https://github.com/WorkplaceX/ApplicationDemo\">ApplicationDemo</a></strong> </p><p>Additionally, WorkplaceX business applications run also embedded in SharePoint or on any already existing company web page by just adding a few lines of html code.</p><p></p>", Sort = 1, SitemapDate = DateTime.Parse("2021-04-21 01:15", CultureInfo.InvariantCulture), IdName = "Home" },
